    .humany-bot-widget {
      right: 20px !important;
    }

    .humany-bot-widget .humany-gentle-list {
      display: none;
    }

    #bank-id-mock {
      display: inline-block;
      border-radius: 10px;
      box-shadow: 0px 0px 11px rgba(0, 0, 0, 0.2);
      width: 400px;
      height: 635px;
      position: fixed;
      bottom: -100%;
      left: 20px;
      transition: bottom ease-out 200ms;
    }

    #bank-id-mock[data-active='true'] {
      bottom: 20px;
    }


    #bank-id-mock-auth-button-container {
      width: 100%;
      position: absolute;
      top: 350px;
    }

    #bank-id-mock-auth-button-container button {
      display: block;
      font-family: Lato;
      font-weight: 700;
      width: 200px;
      border-radius: 5px;
      border: none;
      transition: background-color 200ms ease-out;
      background-color: #469CBE;
      cursor: pointer;
      color: #FFF;
      outline: none;
      margin: 0 auto;
      padding: 20px;
    }

    #bank-id-mock-auth-button-container button:hover {
      background-color: #225971;
    }

    #bank-id-mock[data-loading='false'] #bank-id-mock-auth-loading {
      display: none;
    }

    #bank-id-mock[data-loading='true'] #bank-id-mock-auth-loading {
      display: block;
      position: absolute;
      top: 335px;
      width: 100%;
    }

    #bank-id-mock[data-loading='true'] #bank-id-mock-auth-button-container {
      display: none;
    }

    #bank-id-mock svg {
      position: absolute;
      top: -120px;
    }

    @keyframes ball-scale-ripple {
      0% {
        transform: scale(0.1);
        opacity: 1;
      }

      70% {
        transform: scale(1);
        opacity: 0.7;
      }

      100% {
        opacity: 0.0;
      }
    }

    .ball-scale-ripple>div {
      animation-fill-mode: both;
      height: 80px;
      width: 80px;
      margin: 0 auto;
      border-radius: 100%;
      border: 2px solid #469CBE;
      animation: ball-scale-ripple 1s 0s infinite cubic-bezier(.21, .53, .56, .8);
    }

    #bank-id-logged-in {
      position: fixed;
      bottom: -60px;
      left: 20px;
      transition: bottom ease-out 100ms;
    }

    #bank-id-logged-in button {
      display: block;
      font-family: Lato;
      font-weight: 700;
      width: 200px;
      border-radius: 5px;
      border: none;
      transition: background-color 200ms ease-out;
      background-color: #469CBE;
      cursor: pointer;
      color: #FFF;
      outline: none;
      margin: 0 auto;
      padding: 20px;
    }

    #bank-id-logged-in button:hover {
      background-color: #225971;
    }

    #bank-id-logged-in[data-logged-in='true'] {
      bottom: 20px;
    }
